import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Home extends Component {
    saveCat = (name, image) => {
        fetch('/create', {
            method: 'POST',
            body: JSON.stringify({
                name: name,
                image: image
            }),
            headers: {"Content-Type": "application/json"}
        });
    }
    render() {
        return (
            <div className="App">
                <h1>Project Home</h1>
                <Link to={'./list'}>
                    <button variant="raised">
                        My List
                    </button>
                </Link>
                <Link to={'./saveCat'}>
                    <button variant="raised">
                        saveCat
                    </button>
                </Link>
                <Link to={'./users'}>
                    <button variant="raised">
                        My User
                    </button>
                </Link>
                <Link to={'./Contact'}>
                    <button variant="raised">
                        Contact Me
                    </button>
                </Link>
                <button onClick={() => this.saveCat("Bass Creek", "https://placeimg.com/640/480/nature")} variant="raised">
                    Create
                </button>
            </div>
        )
    }
}

export default Home;
